Starring  Alexis Texas, Sascha, Anthony Rosano, Tori Black, Stormy Daniels, Rocco Reed, Kagney Linn Karter, Marcus London, Manuel Ferrara 

She's (Stormy Daniels) too demanding and he's (Voodoo) too aloof. He's a slob, she's controlling. She works too much, he wont' get a job. Time goes by... They both want out, finally something they can agree on! But at the end of the every ...    Full Descriptionrelationship there's that one awkward moment. That time when you're forced to face each other, maybe at a restaurant, the dry cleaner or maybe the old apartment. And sometimes you ponder the obvious and try to figure out exactly What Went Wrong...and maybe, just maybe, you'll discover everything that went right.
